// Enrollment.jsx

import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import CustomButton from '../Components/Button.jsx';
import TitleSubtitle from '../Components/TitleSubtitle.jsx';
import Popup from '../Pages/Popup.jsx'; 

function Enrollment() {
  const [showPopup, setShowPopup] = useState(false);

  const handleEnregistrerClick = () => {
    setShowPopup(true);
  };

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  return (
    <div className="enrollment-page">
      {/* Bouton Retour avec icône */}
      <Link to="/Home">
        <img
          src="/Vector 9.png"
          alt="Retour"
          className="back-icon" // Ajoutez une classe pour appliquer les styles CSS
        />
      </Link>

      {/* Titre et sous-titre */}
      <TitleSubtitle title="Enroler" subtitle="les contribuables" className="title" />

      {/* Formulaire d'enrôlement */}
      <form className="enrollment-form">

        <div>
          <input type="text" placeholder="Nom et prénom*" style={{ width: '305px', height: '33px' }} />
        </div>
        <div>
          <input type="text" placeholder="Raison sociale" />
        </div>
        <div className="select-container">
          <select style={{ width: '140px', height: '33px' }}>
            <option value="" disabled selected>Zone</option>
            <option value="zone1">Zone 1</option>
            <option value="zone2">Zone 2</option>
            {/* Ajoutez plus d'options si nécessaire */}
          </select>
          <select style={{ width: '140px', height: '33px' }}>
            <option value="" disabled selected>Secteur</option>
            <option value="secteurA">Secteur A</option>
            <option value="secteurB">Secteur B</option>
            {/* Ajoutez plus d'options si nécessaire */}
          </select>
        </div>
        <div className="phone-container">
          <input type="text" placeholder="Téléphone 1" style={{ width: '140px', height: '33px' }} />
          <input type="text" placeholder="Téléphone 2" style={{ width: '140px', height: '33px' }} />
        </div>
        <div>
          <input type="text" placeholder="Montant" style={{ width: '305px', height: '33px' }} />
        </div>
        <div>
          <select style={{ width: '305px', height: '33px' }}>
            <option value="" disabled selected>Catégorie</option>
            <option value="categorie1">Catégorie 1</option>
            <option value="categorie2">Catégorie 2</option>
            {/* Ajoutez plus d'options si nécessaire */}
          </select>
        </div>
        <CustomButton variant="register" onClick={handleEnregistrerClick} />
      </form>

      {/* Pop-up */}
      {showPopup && <Popup onClose={handleClosePopup} />}

      {/* Composant pour le droit d'auteur */}
      <CopyrightText />
    </div>
  );
}

export default Enrollment;
